I couldn't get nix-instantiate --eval to play well with flakes, so I use the following setup. Although I don't usually use a REPL for most languages (python, julia, e.g.), preferring file-based development, unfortunately I couldn't find a more ergonomic setup than using the REPL . I wrap nix repl with a shell script like #!/bin/sh nix repl \ --file "$(dirname "$0")/repl.nix" \ --argstr username "$(whoami)" \ --argstr hostname "$(hostname)" \ --argstr path "/persistent$HOME/.config/home-manager" that loads a repl.nix placed in the same directory. { username, hostname, path }: let self = builtins.getFlake path; nixos = self.nixosConfigurations.${hostname};
in
{ inherit self; ${hostname} = nixos; ${username} = nixos.config.home-manager.users.${username}; inherit (nixos) config pkgs options; inherit (nixos.pkgs) lib;
} This can be then used like nix-repl> <hostname>.config. and press <tab> to see completions. :p can be used to force evaluation. If I have something I want to inspect over and over again, I use a wrapper of nix eval nix eval ".#nixosConfigurations.$(hostname)" --apply "$(hostname): $1" like so. nixos-eval "<hostname>.config.system.activationScripts.usrbinenv"

