Like /bin/sh, /usr/bin/env is an impurity that does not exist at build time . Unlike sh, it can be disabled relatively easily . environment.usrbinenv = null; This can cause issues for unpatched software that rely on env, e.g. prettier installed with npm. There are (currently) also a few minor spurious errors that should be fixed, see this issue . system.activationScripts.usrbinenv = lib.mkIf (config.environment.usrbinenv == null) ( lib.mkForce '' rm -f /usr/bin/env mkdir -p /usr/bin rmdir --ignore-fail-on-non-empty /usr/bin /usr '' );
systemd.services.systemd-update-done.serviceConfig.ExecStart = [ "" # clear ( pkgs.writeShellScript "systemd-update-done-wrapper" '' mkdir -p /usr ${pkgs.systemd}/lib/systemd/systemd-update-done rmdir --ignore-fail-on-non-empty /usr '' )
];

